export const Card = (url, title, profileUrl, authorName, price, quantity) => {
  return (
    <div>
      <img src={url} alt={title} width="480" />
      <h2>{title}</h2>
      <p>{/* Author: <a href={profileUrl}>{authorName}</a> */}</p>
      <p>Price: {price}</p>
      <p>Quantity: {quantity}</p>
      <button>Add</button>
    </div>
  );
};
